INSERT INTO `pay_newlist` (`id`, `title`, `content`, `datetime`, `type`, `zt`) VALUES
(127, '关于7月1日结算延误公告', '&lt;p style=&quot;box-sizing:border-box;margin-top:0px;color:#333333;font-family:&amp;#39;helvetica neue&amp;#39;, helvetica, arial, sans-serif;font-size:14px;line-height:20px;text-indent:2em;background-color:#ffffff;margin-bottom:10px;&quot;&gt;受清分银行影响，7月1日结算款未按时清算到商户账户，我们将在7月4日工作日统一安排清分结算。&lt;/p&gt;&lt;p style=&quot;box-sizing:border-box;margin-top:0px;color:#333333;font-family:&amp;#39;helvetica neue&amp;#39;, helvetica, arial, sans-serif;font-size:14px;line-height:20px;text-align:right;background-color:#ffffff;margin-bottom:10px;&quot;&gt;&lt;span style=&quot;box-sizing:border-box;&quot;&gt;海豚云计费运维&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;box-sizing:border-box;margin-top:0px;color:#333333;font-family:&amp;#39;helvetica neue&amp;#39;, helvetica, arial, sans-serif;font-size:14px;line-height:20px;text-align:right;background-color:#ffffff;margin-bottom:10px;&quot;&gt;&lt;span style=&quot;box-sizing:border-box;&quot;&gt;2016/07/02&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br /&gt;&lt;/p&gt;', '2016-07-04 16:56:07', 2, 0),
(128, '关于部分商户投诉问题通知', '&lt;p&gt;&lt;span style=&quot;color:#333333;font-family:&amp;#39;helvetica neue&amp;#39;, helvetica, arial, sans-serif;font-size:14px;line-height:20px;text-indent:28px;background-color:#ffffff;&quot;&gt;通知，接中信银行微信接口风控部通知，目前视频行业投诉日益增多，为保证接口稳定，所有商户APP页面要统一加上自己的客服退款电话，不许使用支付服务方客服电话，严谨涉黄产品接入，严谨漏点，产生消费疑问应马上退费并电告用户，不许怠慢接口来之不易，请各位商户谨慎对待，信付云计费为保证正常商户使用，凡超过投诉要求，或涉黄我方会即刻关停通道。我方客服电话停用 请替换成你们自己的，如不会操作可联系我方技术协助处理。&lt;/span&gt;&lt;br /&gt;&lt;/p&gt;', '2016-07-07 16:15:50', 2, 0),
(130, 'H5接口添加跳转参数的通知【重要】', '&lt;table border=&quot;1&quot; cellspacing=&quot;0&quot; cellpadding=&quot;0&quot; width=&quot;580&quot; style=&quot;box-sizing:border-box;border-spacing:0px;color:#333333;font-family:&amp;#39;helvetica neue&amp;#39;, helvetica, arial, sans-serif;font-size:14px;line-height:20px;border:currentcolor;background-color:#ffffff;&quot;&gt;&lt;tbody style=&quot;box-sizing:border-box;&quot;&gt;&lt;tr style=&quot;box-sizing:border-box;height:37px;&quot;&gt;&lt;td valign=&quot;top&quot; width=&quot;140&quot; style=&quot;box-sizing:border-box;padding:0cm 7px;border:1px solid #000000;width:140px;height:37px;background-color:transparent;&quot;&gt;&lt;p style=&quot;box-sizing:border-box;margin-top:0px;text-align:center;line-height:21px;margin-bottom:10px;&quot;&gt;&lt;span style=&quot;box-sizing:border-box;color:red;&quot;&gt;pa_MP&lt;/span&gt;&lt;/p&gt;&lt;/td&gt;&lt;td valign=&quot;top&quot; width=&quot;104&quot; style=&quot;box-sizing:border-box;padding:0cm 7px;border-width:1px 1px 1px 0px;border-style:solid solid solid none;border-color:#000000;width:104px;height:37px;background-color:transparent;&quot;&gt;&lt;p style=&quot;box-sizing:border-box;margin-top:0px;text-align:center;line-height:21px;margin-bottom:10px;&quot;&gt;&lt;span style=&quot;box-sizing:border-box;color:red;&quot;&gt;跳转地址&lt;/span&gt;&lt;/p&gt;&lt;/td&gt;&lt;td valign=&quot;top&quot; width=&quot;57&quot; style=&quot;box-sizing:border-box;padding:0cm 7px;border-width:1px 1px 1px 0px;border-style:solid solid solid none;border-color:#000000;width:57px;height:37px;background-color:transparent;&quot;&gt;&lt;p style=&quot;box-sizing:border-box;margin-top:0px;text-align:center;line-height:21px;margin-bottom:10px;&quot;&gt;&lt;span style=&quot;box-sizing:border-box;color:red;&quot;&gt;是&lt;/span&gt;&lt;/p&gt;&lt;/td&gt;&lt;td valign=&quot;top&quot; width=&quot;280&quot; style=&quot;box-sizing:border-box;padding:0cm 7px;border-width:1px 1px 1px 0px;border-style:solid solid solid none;border-color:#000000;width:280px;height:37px;background-color:transparent;&quot;&gt;&lt;p style=&quot;box-sizing:border-box;margin-top:0px;text-align:center;line-height:21px;margin-bottom:10px;&quot;&gt;&lt;span style=&quot;box-sizing:border-box;color:red;&quot;&gt;支付成功后会跳转到这个地址&lt;/span&gt;&lt;/p&gt;&lt;/td&gt;&lt;/tr&gt;&lt;/tbody&gt;&lt;/table&gt;&lt;p style=&quot;box-sizing:border-box;margin-top:0px;color:#333333;font-family:&amp;#39;helvetica neue&amp;#39;, helvetica, arial, sans-serif;font-size:14px;line-height:20px;background-color:#ffffff;margin-bottom:10px;&quot;&gt;&lt;br style=&quot;box-sizing:border-box;&quot; /&gt;这个参数微信/支付宝H5页面调用时可以添加支付完成之后的跳转页面，原值为0.&lt;/p&gt;&lt;p style=&quot;box-sizing:border-box;margin-top:0px;color:#333333;font-family:&amp;#39;helvetica neue&amp;#39;, helvetica, arial, sans-serif;font-size:14px;line-height:20px;background-color:#ffffff;margin-bottom:10px;&quot;&gt;原来的值不修改不影响正常计费.修改好用户体验更佳&lt;/p&gt;&lt;p&gt;&lt;br /&gt;&lt;/p&gt;', '2016-08-19 19:18:39', 2, 0),
(131, '关于部分地区网络波动的说明', '&lt;p&gt;&lt;span style=&quot;color:#333333;font-family:&amp;#39;helvetica neue&amp;#39;, helvetica, arial, sans-serif;font-size:14px;line-height:20px;background-color:#ffffff;&quot;&gt;今日11点左右CDN网络波动导致个别地区首页打不开，现已恢复，数据计费与结算不受影响。&lt;/span&gt;&lt;br /&gt;&lt;/p&gt;', '2016-08-30 12:36:36', 2, 0),
(132, '关于严禁涉黄商户接入通知', '&lt;p&gt;&lt;span style=&quot;color:#333333;font-family:&amp;#39;helvetica neue&amp;#39;, helvetica, arial, sans-serif;font-size:14px;line-height:20px;background-color:#ffffff;&quot;&gt;受本地公安机关督察，微信官方要求。严禁涉黄、及非法应用接入信付云计费服务，一经发现将永久停止合作并扣除结算款项，涉嫌违法犯罪的，将移交相关部门。&lt;/span&gt;&lt;br /&gt;&lt;/p&gt;', '2016-09-01 18:49:25', 2, 0),
(136, '【重要通知】请各商户做好自查工作', '&lt;p style=&quot;box-sizing:border-box;margin-top:0px;color:#333333;font-family:&amp;#39;helvetica neue&amp;#39;, helvetica, arial, sans-serif;font-size:14px;line-height:20px;background-color:#ffffff;margin-bottom:10px;&quot;&gt;近期受网友举报，部分商户APP存在稍裸露图片和视频内容，以及部分APP存在计费BUG导致重复计费问题，本司承诺：所有出现问题商户将全部停止合作，情节严重的将移交相关部门。&lt;/p&gt;&lt;p style=&quot;box-sizing:border-box;margin-top:0px;color:#333333;font-family:&amp;#39;helvetica neue&amp;#39;, helvetica, arial, sans-serif;font-size:14px;line-height:20px;background-color:#ffffff;margin-bottom:10px;&quot;&gt;举报电话：0817-2445360王经理。&lt;/p&gt;&lt;p&gt;&lt;br /&gt;&lt;/p&gt;', '2016-07-04 16:56:07', 2, 0),
(137, '新增微信H5通道，欢迎商户上量！', '&lt;p&gt;新增微信H5通道，欢迎商户上量！&lt;br /&gt;&lt;/p&gt;', '2017-01-15 07:10:32', 2, 0),
(138, '增加一条新闻信息', '&lt;p&gt;新闻内容&lt;br /&gt;&lt;/p&gt;&lt;p&gt;&lt;span&gt;新闻内容&lt;/span&gt;&lt;br /&gt;&lt;/p&gt;&lt;p&gt;&lt;span&gt;&lt;span&gt;新闻内容&lt;/span&gt;&lt;br /&gt;&lt;/span&gt;&lt;/p&gt;', '2017-09-22 10:34:49', 1, 0),
(139, '好消息，微信和支付宝H5支付均已恢复！', '&lt;p&gt;经过多方努力和紧张调试，微信和支付宝的WAP支付（H5）均已恢复运行，请大家且用且珍惜！&lt;br /&gt;&lt;/p&gt;', '2018-02-25 21:24:06', 2, 0);
